import mongoose from "mongoose";
import { ObjectID } from "mongodb";

const Schema = mongoose.Schema;

ObjectID.prototype.valueOf = function () {
    return this.toString();
};

const vehicleSchema = new Schema({
    type: {                 //2 wheeler or 4 wheeler
        type: String,
        required: true
    },
    manufacturer: {
        type: String,
        required: true
    },
    model: {
        type: String,
        required: true
    },
    transmission: {
        type: String,
        required: true
    },
    fueltype: {
        type: String,
        required: true
    },
    seats: {
        type: Number,
        required: true
    },
    odometer: {
        type: Number,
        // required: true,
        // default: 0
    },
    price: {
        type: Number,
        // required: true,
        // default: 0
    },
    location: {
        type: String,
        // required: true
    },
    islive: {
        type: Boolean,
        required: true,
        default: false
    },
    pickupTime: {
        type: String,
        // required: true
    },
    // dropTime: { 
    //     type: Date,
    //     required: true
    // },
    user: {
        type: Schema.Types.ObjectId,
        ref: 'User',
        required: true
    }


})

export default mongoose.model("Vehicle", vehicleSchema);

